import React from 'react';

checkStatus = () => {
    this.props.checkedChannelType.map((element) =>{
        console.log(element);
        if(element.type === props.label)
            return element.value;
    });
}

class CheckBox extends React.Component {
    render(){
        return (
            <div>   
                <input type="checkbox" id={props.itemType} name={props.label} onChange = {props.onChangeChannelType}
                checked = {this.checkStatus}/>
                <label>{props.label}</label>
            </div>
        );
    }
}

export default CheckBox;
